import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { 
  Typography, 
  Grid, 
  Card, 
  CardContent, 
  CardActions, 
  Button, 
  Chip, 
  Box,
  CircularProgress,
  Paper,
  Alert
} from '@mui/material';
import { Card as CardType } from '../types';
import { getAllCards } from '../services/api';
import { useAuth } from '../context/AuthContext';

const Dashboard: React.FC = () => {
  const { authState } = useAuth();
  const [cards, setCards] = useState<CardType[]>([]);
  const [loading, setLoading] = useState<boolean>(true);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    const fetchCards = async () => {
      try {
        setLoading(true);
        const fetchedCards = await getAllCards();
        setCards(fetchedCards);
      } catch (err: any) {
        setError(err.response?.data?.error || err.message || 'Failed to fetch cards');
      } finally {
        setLoading(false);
      }
    };

    fetchCards();
  }, []);

  if (loading) {
    return (
      <Box sx={{ display: 'flex', justifyContent: 'center', p: 5 }}>
        <CircularProgress />
      </Box>
    );
  }

  if (error) {
    return (
      <Box sx={{ p: 3, color: 'error.main' }}>
        <Typography variant="h6">Error: {error}</Typography>
        <Button variant="contained" onClick={() => window.location.reload()}>
          Retry
        </Button>
      </Box>
    );
  }

  return (
    <div>
      <Paper sx={{ p: 3, mb: 4, bgcolor: 'background.default' }}>
        <Typography variant="h4" component="h1" gutterBottom>
          Welcome, {authState.user?.name || authState.user?.username || 'User'}!
        </Typography>
        <Typography variant="body1">
          Manage your virtual cards and transactions from this dashboard.
        </Typography>
        {authState.user && (
          <Box sx={{ mt: 2 }}>
            <Typography variant="body2" color="text.secondary">
              Your Cardholder ID: {authState.user.cardholderId}
            </Typography>
          </Box>
        )}
      </Paper>

      <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 3 }}>
        <Typography variant="h5">
          Your Virtual Cards
        </Typography>
        <Button 
          variant="contained" 
          color="primary" 
          component={Link} 
          to="/cards/new"
        >
          Create New Card
        </Button>
      </Box>

      {cards.length === 0 ? (
        <Card sx={{ p: 4, textAlign: 'center' }}>
          <CardContent>
            <Typography variant="h6" color="text.secondary" gutterBottom>
              You don't have any virtual cards yet
            </Typography>
            <Typography variant="body2" color="text.secondary">
              Create your first virtual card to get started
            </Typography>
          </CardContent>
          <CardActions sx={{ justifyContent: 'center' }}>
            <Button 
              variant="contained" 
              color="primary" 
              component={Link} 
              to="/cards/new"
            >
              Create First Card
            </Button>
          </CardActions>
        </Card>
      ) : (
        <Grid container spacing={3}>
          {cards.map((card) => (
            <Grid item xs={12} sm={6} md={4} key={card.id}>
              <Card sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}>
                <CardContent sx={{ flexGrow: 1 }}>
                  <Box sx={{ display: 'flex', justifyContent: 'space-between', mb: 2 }}>
                    <Typography variant="h6" component="div">
                      {card.last4 
                        ? `**** **** **** ${card.last4}` 
                        : card.masked_pan 
                          ? card.masked_pan 
                          : '**** **** **** 0000'}
                    </Typography>
                    <Chip 
                      label={card.status} 
                      color={card.status === 'active' ? 'success' : 'default'} 
                      size="small" 
                    />
                  </Box>
                  <Typography variant="body1" color="text.primary" gutterBottom>
                    {card.description || 'No description'}
                  </Typography>
                  <Typography variant="body2" color="text.secondary">
                    Created: {new Date(card.createdAt).toLocaleDateString()}
                  </Typography>
                </CardContent>
                <CardActions>
                  <Button 
                    size="small" 
                    component={Link} 
                    to={`/cards/${card.id}`}
                  >
                    View Details
                  </Button>
                </CardActions>
              </Card>
            </Grid>
          ))}
        </Grid>
      )}
    </div>
  );
};

export default Dashboard;
